import React from "react";
import { Link } from "react-router-dom";

// קומפוננטה ריקה - הדף הוסר לפי בקשת המשתמש
const ContactUs = () => {
  return (
    <div style={{ padding: "20px", textAlign: "center", direction: "rtl" }}>
      <h2>דף זה הוסר</h2>
      <p>דף יצירת הקשר הוסר מהמערכת.</p>
      <div>
        <Link to="/" style={{ 
          display: "inline-block", 
          margin: "20px", 
          padding: "10px 20px", 
          background: "#4CAF50", 
          color: "white", 
          textDecoration: "none", 
          borderRadius: "4px" 
        }}>
          חזרה לדף הבית
        </Link>
      </div>
    </div>
  );
};

export default ContactUs;
